      <Stack.Screen name="Search" component={Search} options={{
        //  headerRight: () => headerRight(),

          headerStyle: {
            backgroundColor: '#111315',

            shadowOpacity: 0,


          },
          headerTintColor: '#fff',
          headerTitleStyle: {

          },
        headerShown: false,
        }}/>
      <Stack.Screen name="Profile" component={Profile} options={{
          // title: '',
          headerStyle: {
            backgroundColor: '#fff',
            shadowOpacity: 0,
            shadowColor: "#fff",
            borderColor: "#fff",
          },
          headerTintColor: '#000',
          headerTitleStyle: {

          },
          headerShown: false,
        }}/>
    </Stack.Navigator>
  </NavigationContainer>
  );
}
